Ext.define('Shopware.apps.Emotion.view.detail.elements.nnwebEmotionBlur', {

    extend: 'Shopware.apps.Emotion.view.detail.elements.Base',

    alias: 'widget.detail-element-emotion-components-nnweb-emotion-blur',

    componentCls: 'emotion--nnweb-emotion-blur',

    icon: ' data:image/png;base64,',

    createPreview: function() {
        var me = this,
            preview = '',
            image = me.getConfigValue('nnwebEmotionBlur_hintergrundbild'),
            position = 'center center',
            style;

        console.log(image);
        if (Ext.isDefined(image)) {
            style = Ext.String.format('background-image: url([0]); background-position: [1];', image, position);

            preview = Ext.String.format('<div class="x-emotion-banner-element-preview" style="[0]"></div>', style);
        }

        return preview;
    }
});
